import React from 'react'
import styled from 'styled-components'

import { THEME } from '../../../theme'

const StyledLink = styled.a`
  color: ${ THEME.FONT_COLOR },
  text-decoration: none,
  cursor: pointer;
`

export const AppLink = ({ children, ...rest }) => (
  <a { ...rest }>
    { children }
  </a>
)
